import React from "react";

export default function JobSearch({ search, setSearch }) {
  return (
    <input
      type="text"
      value={search}
      onChange={(e) => setSearch(e.target.value)}
      placeholder="Search jobs..."
      className="w-full p-2 mb-4 rounded border"
    />
  );
}
